script: |
  super -f text -I q7659.spq | sort > q7659.out

inputs:
  - name: q7659.spq
    data: |
      SELECT - col0 * + tab2.col0 / tab2.col0 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN + col0 AND NULL AND NOT ( + col2 * + col0 ) IN ( - col0 * col1 );
  - name: tab2

outputs:
  - name: q7659.out
    data: |
